package basicprogram;

public class SumProj {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		float a=10.5f;
		float b=10.5f;
		float sum=a+b;
		double x=50.5;
		double y=15.5;
		double diff=x-y; 
		System.out.println("Sum of float values is "+sum);
		System.out.println("Difference of double value is "+diff);

	}

}
